  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `t_gwry_ryxx`;
CREATE TABLE `t_gwry_ryxx` (
  `id` varchar(50) NOT NULL,
  `jf` double DEFAULT NULL comment '积分',
  `csrq` datetime DEFAULT NULL comment '出生日期',
  `cjsj` datetime DEFAULT NULL comment '采集时间',
