  `sjzt` int(11) DEFAULT NULL comment '状态，0表示新，1表示旧',
  `sjly` varchar(255) DEFAULT NULL comment '数据来源',
  `mz` varchar(255) DEFAULT NULL comment '民族，字典项',
  `fksj` datetime DEFAULT NULL comment '反馈时间',
  `czqk` varchar(255) DEFAULT NULL comment '处置情况',
  `sfzh` varchar(255) DEFAULT NULL comment '身份证号',
  `zkdjsj` datetime DEFAULT NULL comment '在控登记时间',
  `sr` int(11) DEFAULT NULL comment '收入',
  `jzdz` varchar(255) DEFAULT NULL comment '居住地址',
  `xzdxz` varchar(255) DEFAULT NULL comment '现住地详址',
  `xm` varchar(255) DEFAULT NULL comment '姓名',
  `gj` varchar(255) DEFAULT NULL comment '国籍，字典项',
  `wh` varchar(255) DEFAULT NULL comment '外号',
  `jg` varchar(255) DEFAULT NULL comment '籍贯，字典项',
  `zklx` varchar(255) DEFAULT NULL comment '在控类型，字典项',
  `zy` varchar(255) DEFAULT NULL comment '职业',
  `hjdz` varchar(255) DEFAULT NULL comment '户籍地址',
  `hjdxz` varchar(255) DEFAULT NULL comment '户籍地详址',
  `hjdpcs` varchar(255) DEFAULT NULL comment '户籍地派出所',
  `xb` varchar(255) DEFAULT NULL comment '性别，字典项',
  `rczk` varchar(255) DEFAULT NULL comment '日常状况，0正常，1异常',
  `njjg` varchar(255) DEFAULT NULL comment '尿检结果',
  `yjlx` varchar(255) DEFAULT NULL comment '预警类型，字典项',
  `gzdz` varchar(255) DEFAULT NULL comment '工作地址',
  `xzyy` varchar(255) default NULL comment '新增原因',
  `whcd` varchar(255) default NULL comment '文化程度，字典项',
  `jyqk` varchar(255) default NULL comment '就业情况，字典项',
  `hyqk` varchar(255) default NULL comment '婚姻情况，字典项',
  `czzt` varchar(255) default NULL comment '操作状态：0新增1待审批2审批通过3审批驳回',
  `cym`  varchar(255) default NULL comment '曾用名', 
  `gxsj` datetime DEFAULT NULL comment '实战平台更新时间',
  `sjc` datetime DEFAULT NULL comment '外部系统导入时间戳',
  UNIQUE KEY `sfzh_UNIQUE` (`sfzh`),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8  COMMENT='高危人员信息';

