DROP TABLE IF EXISTS `t_gwry_czjl`;
CREATE TABLE `t_gwry_czjl` (
  `id` varchar(36) NOT NULL,
  `cznr` varchar(255) DEFAULT NULL comment '操作内容（编码） 高危人员调整:五色+其他；人员类型调整：人员类型',
  `czfs` varchar(255) DEFAULT NULL comment '操作方式（常量值）  高危人员调整-新增/删除；人员类型调整-新增/删除',
  `czsj` datetime DEFAULT NULL comment '操作时间',
  `czlx` varchar(255) DEFAULT NULL comment '操作类型（常量值）   高危人群调整；人员类型调整',
  `czdxid` varchar(255) DEFAULT NULL comment '操作对象id',
  `czdxlx` varchar(255) DEFAULT NULL comment '操作对象（类名）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='高危人员信息操作记录';



DROP TABLE IF EXISTS `t_gwry_gwrylx`;
